#include <stdio.h>

int strStr(char* haystack, char* needle) {
    
    int j=0, curr=0;
    
    if ( ! needle[0]) {
        return 0;
    }
    while ( haystack[curr] ) {
        if ( haystack[curr] == needle[0]) {
            j = 0;
            while ((needle[j]) && (haystack[curr+j]) && 
                   (needle[j] == haystack[curr+j])) {
                j++;
            }
            if (needle[j]) { 
                // not a match
                curr++;
            } else {
                return curr;
            }
        }
        curr++;
    }
    return -1;   
}

int main() {

	printf("%d\n", strStr("hello", "llo"));
	printf("%d\n", strStr("hello", "llo"));

}

